// Contact.js
import React, { useState } from 'react';
import './Register.css';
import apiClient from '../communication/apiClient'

const Register = () => {
  const [name, setName] = useState('');
  const [email, setEmail] = useState('');

   const btn_submit = (e) => 
  {
    e.preventDefault();
    
    const requestParams  = {
        name,
        email,
        timestamp: Date.now(),
        version: '1.0'
      };
      handleLogin(requestParams);
  };
  ////////////////////////////////////////////
  const handleLogin = async (requestParams) => {
    try {
        const val={
          params: requestParams,
          headers: 
          {
            'Content-Type': 'application/json',
            'Authorization': 'Bearer your-token-here'
          }
        }    
        console.log("dfgfdgdfgdfgdg@@@@@@@@@@", val);
        const response = await apiClient.get('/test', val);
        console.log(response);
    } catch (error) {
      console.error(error.response?.data || 'Submission error.. Try Again');
    }
  };
//_____________________________________________________________________________________________________________________________
const handleName = (e) => {
    setName(e.target.value);
};
//_____________________________________________________________________________________________________________________________
const handleEmail = (e) => {
  setEmail(e.target.value);
};
//_____________________________________________________________________________________________________________________________













  return (
    <div className="contact-container">
      <h2>USER REGISTRATION</h2>
      <form className="contact-form"  >
        <div className="form-group">
          <label htmlFor="name">Name:</label>
          <input type="text" id="name" name="name" onChange={handleName} />
        </div>
        <div className="form-group">
          <label htmlFor="email">Email:</label>
          <input type="email" id="email" name="email" onChange={handleEmail}/>
        </div>
  
        <button className="submit-button" onClick={btn_submit}>Submit</button>
      </form>
      {/* {formStatus && <p className="form-status">{formStatus}</p>} */}
    </div>
  );
};

export default Register;
